style.css:
@-moz-document domain("www.pokepedia.fr") {
h1, h2, h3, h4, h5, h6 {
  color: #f8f9fa;
}

a {
  color: lightblue;
}


a, .vector-feature-zebra-design-enabled .vector-toc .vector-toc-link {
  color: lightblue;
}

.vector-feature-zebra-design-enabled .vector-pinned-container,
.vector-feature-zebra-design-enabled body,
.vector-feature-zebra-design-enabled .vector-header-container,
.vector-feature-zebra-design-enabled .vector-page-toolbar,
.vector-feature-zebra-design-enabled .vector-page-titlebar,
.vector-feature-zebra-design-enabled .vector-body {
  background-color: #202122;
  color: #f8f9fa;
}

table.ruban-pokemon.centre,
table.tableaustandard,
table.tableaustandard td,
table.tableaustandard table {
  background-color: #202122 !important;
  color: #f8f9fa !important;
  }
}
